(1, 'about.html', '<p>York University was founded in March 1959, and is now Canada''s third-largest university and its leading interdisciplinary research and teaching institution.</p>\r\n<ul>\r\n<li>Home to the Schulich School of Business, Canada''s Global Business School, ranked one of the top 10 MBA Schools worldwide</li>\r\n<li>Home to Osgoode Hall Law School, Canada''s pre-eminent law school and the largest and oldest common-law law school in the country</li>\r\n<li>The Faculty of Fine Arts is the first and largest comprehensive faculty in Canada</li>\r\n<li>Glendon is the only bilingual campus of its kind in Canada</li>\r\n<li>The largest and most academically diverse psychology program in Canada</li>\r\n<li>Offers Canada''s only space engineering program</li>\r\n<li>2 professional centres located in downtown Toronto: Osgoode Professional Development Centre and Miles S. Nadal Management Centre, Schulich School of Business</li>\r\n<li>As one of the largest faculties in Canada, the Faculty of Liberal Arts& Professional Studies offers the most comprehensive range of programs in the social sciences, the humanities and related professional fields</li>\r\n</ul>'),
(2, 'location.html', '<p>Two campuses located in the heart of the Greater Toronto Area (GTA), Canada''s largest metropolis.</p>'),
(3, 'students.html', '<ul>\r\n<li>54,000 students: 48,000 undergraduates; 6,000 graduates</li>\r\n<li>Total of 11,430 degrees awarded in 2010</li>\r\n</ul>'),
(4, 'size.html', '<ul>\r\n<li>Keele Campus is 457 acres</li>\r\n<li>Glendon Campus is 85 acres</li>\r\n<li>9 undergraduate residences</li>\r\n<li>More Than 7,000 faculty and staff</li>\r\n</ul>'),
(5, 'research.html', '<p>Our 28 interdisciplinary and collaborative research centres deliver real-world solutions to real-world challenges. Strengths in vision and space sciences, history and refugee studies, health, the environment, climate change, sustainability and digital media.</p>'),
(6, 'faculties.html', '<p>10 faculties offering more than 5,000 courses:</p>\r\n<ul>\r\n<li>Education</li>\r\n<li>Environmental Studies</li>\r\n<li>Fine Arts</li>\r\n<li>Glendon</li>\r\n<li>Graduate Studies</li>\r\n<li>Health</li>\r\n<li>Liberal Arts &amp; Professional Studies</li>\r\n<li>Osgoode Hall Law School</li>\r\n<li>Schulich School of Business</li>\r\n<li>Science &amp; Engineering</li>\r\n</ul>'),
(7, 'libraries.html', '<p>Located in 5 buildings, our libraries employ 48 professional librarians, have more than 2.6 million printed volumes, 266,000 e-books and more than 40,000 full text e-journals, 500 computer workstations and 2,900 study seats. York libraries are visited by over 3 million people annually.</p>'),
(8, 'studentlife.html', '<p>With more than 290 student clubs and organizations, the intellectual, cultural and social life at York is one of the richest in Canada. In 2010, the York University Lions men''s soccer team were crowned Canadian Interuniversity Sport champions for the second time in the past three years.</p>'),
(9, 'alumni.html', '<p>Our family of more than 240,000 alumni spans the globe, redefining leadership in business, fine arts, public policy, the law, science, education, history, criminology, environmental sciences, psychology - and the list goes on.</p>'),
(10, 'global.html', '<p>York has established its reputation worldwide with 280 partnerships with international universities, attracting international students with roots tracing back to 155 countries.</p>');
